Estate o inverno, dalle gite in Alta Badia alle discese sul Plan de Corones ai venticinque anni da cui trascorro il mese di agosto a Cortina e, da quando è nata mia figlia, tra Cortina e San Cassiano —  i ricordi più belli e i periodi più felici della mia vita sono legati sempre e per sempre alle Dolomiti.

Triestina d’origine, vivo a Milano dai tempi dell’universitá e l’Alto Adige non è esattamente ad un tiro di schioppo, ma di recente ho scoperto la Val d’Aosta e le montagne intorno al Lago di Lecco e iniziato a collezionare passeggiate e ricordi molto belli anche a poco più di un’ora da casa. 

Domani, ad esempio, parto per Brusson dove trascorreró il weekend da amici come giá lo scorso anno è capitato sia in autunno sia sulla neve. Sono eccitata di rivedere le montagne, di assaporare ancora la cucina valdostana, di sentire di nuovo il bisogno di tirare su la coperta la sera mentre mi addormento. E magari trovare il tempo di condividere con voi quel che trovo e quel che provo.

A presto dunque e buon weekend !

